    <div class=\"col-xs1\">Email:</div>
    <div class=\"col-xs3\">{{app.user.email}}</div>
    <div class=\"col-xs3\">Username : </div>
    <div class=\"col-xs1\">{{app.user.username}}</div>
    <div class=\"col-xs4\">
        <a href=\"{{ path('user_profile_edit') }}\" class=\"btn blue\">Modifier le profil</a>
        <a href=\"{{ path('user_password_edit') }}\" class=\"btn blue\">Modifier le mot de passe</a>
    </div>

    <div class=\"col-xs4\">
        <h1>Questions de {{app.user.username}} ({{app.user.questions|length}})</h1>
        {% for question in app.user.questions %}
        <div class=\"col-xs1\">Question :</div>
        <div class=\"col-xs3\">{{question.label}}</div>
       <a href=\"/questions/{{question.id}}\">Details</a>
        {% endfor %}
    </div>
  
    

</div>
    
{% endblock %}", "user/index.html.twig", "D:\\Users\\flo59\\Documents\\ETUDE\\LP_DIM\\PollsSymfony\\Poll\\templates\\user\\index.html.twig");
